Goldbird - Olympic Gymnasts Topless and Nude DVDRip.mp4

In 2002, three Romanian Olympic Gymnasts performed their routines like no one had seen them before - topless and nude.

Claudia Presecan (23) - Gold Medallist (Team) at Sydney 2000
Corina Ungureanu (22) - World Champion Gymnast
Lavinia Milosovici (26) - Dual Gold Medallist (Floor &amp; Vault) at Barcelona 1992 plus Silver &amp; three Bronze at Atlanta 1996

The three girls have been banned by the Romanian Gymnastics Federation for 5 years. They were primarily banned for wearing the Romanian Olympic uniform in some photos that were taken at the same time the videos were taken.

